export default function Students (){

    return(
        <>
        <PageHeader
      title="Add Student"
      subTitle="na the page sub tieilw bw this"
      icon={<PeopleOutlineIcon fontSize='large' />}/>

        <StudentForm/>
        </>

    )

}
